('3443', 'New Year Contest', '<p>Maybe you are all about taking a step back at the beginning of a new year and reflecting, planning and generally making sure that you are constantly <a href=\"https://www.plannthat.com/business-growth/\">growing</a> into the best version of yourself. If that is you, these insightful new years captions are definitely your cup of tea.</p><p>&nbsp;</p><p><i>If you are not obsessed with your life, change it.</i></p><p>&nbsp;</p><p><i>Let 2019 be the year that you get out of your own way â?? Sam Brown</i></p><p>&nbsp;</p><p><i>Whatâ??s coming is better than what has gone â?? @minna_so</i></p>', '2019-07-29 07:00:00.000000', '2019-07-31 09:00:00.000000', 'none', 'shaykhsiddique', );
INSERT INTO `contests` (`contest_id`, `contest_title`, `contest_desp`, `start_time`, `end_time`, `participants`, `contest_author`, `banner_data`) VALUES
('3455', 'Winter Contest 2018', '<p>Pattern letters are usually repeated, as their number determines the exact presentation:</p><ul><li><strong>Text:</strong> For formatting, if the number of pattern letters is 4 or more, the full form is used; otherwise a short or abbreviated form is used if available. For parsing, both forms are accepted, independent of the number of pattern letters.<br><br>&nbsp;</li><li><strong>Number:</strong> For formatting, the number of pattern letters is the minimum number of digits, and shorter numbers are zero-padded to this amount. For parsing, the number of pattern letters is ignored unless it\'s needed to separate two adjacent fields.<br><br>&nbsp;</li><li><strong>Year:</strong> If the formatter\'s <a href=\"https://docs.oracle.com/javase/7/docs/api/java/text/DateFormat.html#getCalendar()\">Calendar</a> is the Gregorian calendar, the following rules are applied.<br><ul><li>For formatting, if the number of pattern letters is 2, the year is truncated to 2 digits; otherwise it is interpreted as a <a href=\"https://docs.oracle.com/javase/7/docs/api/java/text/SimpleDateFormat.html#number\">number</a>.</li><li>For parsing, if the number of pattern letters is more than 2, the year is interpreted literally, regardless of the number of digits. So using the pattern \"MM/dd/yyyy\", \"01/11/12\" parses to Jan 11, 12 A.D.</li><li>For parsing with the abbreviated year pattern (\"y\" or \"yy\"), SimpleDateFormat must interpret the abbreviated year relative to some century. It does this by adjusting dates to be within 80 years before and 20 years after the time the SimpleDateFormat instance is created. For example, using a pattern of \"MM/dd/yy\" and a SimpleDateFormat instance created on Jan 1, 1997, the string \"01/11/12\" would be interpreted as Jan 11, 2012 while the string \"05/04/64\" would be interpreted as May 4, 1964. During parsing, only strings consisting of exactly two digits, as defined by <a href=\"https://docs.oracle.com/javase/7/docs/api/java/lang/Character.html#isDigit(char)\">Character.isDigit(char)</a>, will be parsed into the default century. Any other numeric string, such as a one digit string, a three or more digit string, or a two digit string that isn\'t all digits (for example, \"-1\"), is interpreted literally. So \"01/02/3\" or \"01/02/003\" are parsed, using the same pattern, as Jan 2, 3 AD. Likewise, \"01/02/-3\" is parsed as Jan 2, 4 BC.</li></ul></li></ul>', '2018-12-02 16:00:00.000000', '2018-12-02 20:00:00.000000', 'none', 'shaykhsiddique', );
