('3477', 'Test Running Contest 1', '<p>sep is just a shorthand for &lt;#if <i>item</i>?has_next&gt;...&lt;/#if&gt;. Thus, it can be used anywhere where there\'s a list or items loop variable available, it can occur for multiple times, and it can have arbitrary nested content.</p><p>The parser ensures that sep is only used on a place where there\'s a visible loop variable. This happens earlier than the actual execution of the template. Thus, you can\'t move sep from inside the associated list or items directive into a macro or included template (the parser can\'t know where those will be called from).</p>', '2019-07-27 16:27:00.000000', '2019-07-27 23:00:00.000000', 'none', 'shaykhsiddique', );

